import React, {Component} from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import '././css/Stock.css';

class Stock extends Component {
	render(){
		return(
			<div>
				<h className ="title"> United States Stocks </h>

				<Container className = "filter-title">
					<Row>
						<Col> 
							Market 
							<div className ="wrapper">
								<div className ="header">
									<div className = "header-title"> United States </div>
								</div>
								<ul className ="list">
									<li className = "list-item">a </li>
									<li className = "list-item">b </li>
									<li className = "list-item">c </li>
								</ul>
							</div>
						</Col>
						<Col> 
							Industry 
							<div className = "filter"> Any </div>
						</Col>
						<Col className ='more-filter'> More Filters </Col>
					</Row>
				</Container>
			</div>

		);
	}
}
export default Stock;
